import React from "react";
import { useLocation } from "react-router-dom";

const Transaction = () => {
  const location = useLocation();

  // Helper to extract query params
  const getQueryParams = () => {
    const params = new URLSearchParams(location.search);
    const entries = {};
    for (let [key, value] of params.entries()) {
      entries[key] = value;
    }
    return entries;
  };

  const transactionData = getQueryParams();

  return (
    <div style={{ padding: "2rem", textAlign: "center" }}>
      <h2>ðŸŽ‰ Transaction Status</h2>
      <p>Below are the details returned after the payment:</p>

      <table style={{ margin: "auto", textAlign: "left", borderCollapse: "collapse" }}>
        <tbody>
          {Object.entries(transactionData).map(([key, value]) => (
            <tr key={key}>
              <th style={{ padding: "8px", border: "1px solid #ccc" }}>{key}</th>
              <td style={{ padding: "8px", border: "1px solid #ccc" }}>{value}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Transaction;
